import React from 'react';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import './css/About.css';
import Typography from '@material-ui/core/Typography';
import {withStyles, createStyles} from '@material-ui/styles';
import StyledProps from './StyledProps';

const Contact = (props: StyledProps) => {
  const classes = props.classes;
  return (   
    <Box>
      <Container className={classes.contact} maxWidth={false}>
        <Box display={{xs: 'block', sm: 'flex', md: 'flex', lg: 'flex'}}>
          <Box className={classes.contactBox}>
            <Typography className={classes.text}>Email</Typography>
          </Box>
          <Box className={classes.contactBox}>
            <Typography className={classes.text}>Linkedin</Typography>
          </Box>
          <Box className={classes.contactBox}>
            <Typography className={classes.text}>Soundcloud</Typography>
          </Box>
        </Box>
      </Container>
    </Box> 
  );
}

const useStyles = createStyles({
  contact: {
    display: 'flex',
    flexDirection: 'column',
    backgroundColor: '#8F8073',
    alignItems: 'center',
    padding: '4rem 0',
  },
  contactTitle: {
    fontFamily: 'Montserrat',
    color: '#12130F',
    fontSize: '3rem',
  },
  text: {
    fontFamily: 'Montserrat',
    color: '#12130F',
    fontSize: '2rem',
  },
  contactBox: {
    padding: '1rem',
  }
});

export default withStyles(useStyles)(Contact);
